import React from 'react';
export default function test({ countries }) {
    return (
        <div >
            <details className='item_list item__cuttom'>
                {countries.map(({ Country, ISO2 }) => (
                    <li key={ISO2} value={ISO2.toLowerCase()} >
                        {Country}
                    </li>
                ))} 
            </details>
        </div>
    );

}
